eption Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0mm 5.4pt 0mm 5.4pt;\r\n	mso-para-margin-top:0mm;\r\n	mso-para-margin-right:0mm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0mm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#222222;\r\nbackground:white\">PT. IWEBE BANGUN SOLUSI</span></b><span style=\"font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;color:#222222;background:white\"> Indonesia adalah\r\nmerupakan Associate Member dari <b style=\"mso-bidi-font-weight:normal\">IWEBE\r\nBUILDING SOLUTIONS (AUS) Pty.Ltd</b> yang dipimpin oleh Tim Pakar Electrical\r\nEngineer yang telah berpengalaman lebih dari 25 tahun pada bidang Instalasi\r\nM&amp;E dengan track record <b style=\"mso-bidi-font-weight:normal\">KEJUJURAN</b>\r\npada berbagai bangunan seperti Bangunan Hotel, Apartement, Rumah Sakit, Gedung\r\nPerkantoran, Gerai Retail dan lain-lain.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Tujuan\r\ndidirikannya PT. Iwebe Bangun Solusi adalah untuk menjadi pilihan utama bagi\r\nmitra bisnis kami dengan memberikan kontribusi kepada setiap klien kami, melebihi\r\ndari yang mereka harapkan melalui Kebutuhan dan Pelayanan istimewa dari kami\r\nsecara profesional dan integritas penuh. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:12.0pt;\r\nline-height:107%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">PT. Iwebe Bangun Solusi</span></b><span style=\"font-size:12.0pt;line-height:107%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">\r\ndalam menjalankan bisnis pengadaan, kami di dukung oleh Principal berbagai Merk\r\nyang ternama yang ada di Indonesia dan mempunyai tenaga yang ahli, berkualitas\r\ndan berpengalaman dari Sector Pekerjaan dan Perbaikan. karena kami yakin, hanya\r\ndengan sumber daya yang tinggi kami dapat menghasilkan kualitas pekerjaan dan\r\npelayanan yang baik sesuai yang di harapkan mitra bisnis kami<span style=\"color:#222222;background:white\"></span></span></p>\r\n\r\n','about_us',NULL,'Y',37,'zulhendri','update','2020-03-08 13:39:14'),(1,32,13,'About Us','<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapTo