pan style=\"font-family:\r\n\" times=\"\" new=\"\" roman\",\"serif\";color:#222222;background:white\"=\"\"><span style=\"font-family: \" arial\";\"=\"\"> Indonesia adalah\r\nmerupakan Associate Member dari </span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family: \" arial\";\"=\"\">IWEBE\r\nBUILDING SOLUTIONS (AUS) Pty.Ltd</span></b><span style=\"font-family: \" arial\";\"=\"\"> yang dipimpin oleh Tim Pakar Electrical\r\nEngineer yang telah berpengalaman lebih dari 25 tahun pada bidang Instalasi\r\nM&amp;E dengan track record </span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-family: \" arial\";\"=\"\">KEJUJURAN</span></b><span style=\"font-family: \" arial\";\"=\"\">\r\npada berbagai bangunan seperti Bangunan Hotel, Apartement, Rumah Sakit, Gedung\r\nPerkantoran, Gerai Retail dan lain-lain.</span></span></p><span style=\"font-family: \" arial\";\"=\"\">\r\n\r\n</span><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family: \" arial\";\"=\"\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">Tujuan\r\ndidirikannya PT. Iwebe Bangun Solusi adalah untuk menjadi pilihan utama bagi\r\nmitra bisnis kami dengan memberikan kontribusi kepada setiap klien kami, melebihi\r\ndari yang mereka harapkan melalui Kebutuhan dan Pelayanan istimewa dari kami\r\nsecara profesional dan integritas penuh. </span></p><span style=\"font-family: \" arial\";\"=\"\">\r\n\r\n</span><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size: 12pt; line-height: 107%; font-family: \" arial\";\"=\"\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\">PT. Iwebe Bangun Solusi</span></b><span style=\"font-size:12.0pt;line-height:107%;font-family:\" times=\"\" new=\"\" roman\",\"serif\"\"=\"\"><span style=\"font-family: \" arial\";\"=\"\">\r\ndalam menjalankan bisnis pengadaan, kami di dukung oleh Principal berbagai Merk\r\nyang ternama yang ada di Indonesia dan mempunyai tenaga yang ahli, berkualitas\r\ndan berpengalaman dari Sector Pekerjaan dan Perbaikan. karena kami yakin, hanya\r\ndengan sumber daya yang tinggi kami dapat menghasilkan kualitas pekerjaan dan\r\npelayanan yang baik sesuai yang di harapkan mitra bisnis kami</span><span style=\"color:#222222;background:white\"></span></span></p><span style=\"font-family: \" arial\";\"=\"\">\r\n\r\n</span>','about_us',NULL,'Y',40,'zulhendri','update','2020-03-08 13:48:07'),(1,32,13,'About Us','<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\r\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\r\n   <w:DontFlipMirrorIndents></w:DontFlipMirrorIndents>\r\n   <w:OverrideTableStyleHps></w:OverrideTableStyleHps>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"></m:mathFont>\r\n   <m:brkBin m:val=\"before\"></m:brkBin>\r\n   <m:brkBinSub m:val=\"--\"></m:brkBinSub>\r\n   <m:smallFrac m:val=\"off\"></m:smallFrac>\r\n   <m:dispDef></m:dispDef>\r\n   <m:l