DROP TABLE IF EXISTS log_position;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE log_position (
  `id` int(11) NOT NULL,
  caption varchar(32) NOT NULL,
  description varchar(255) NOT NULL,
  seq int(11) NOT NULL DEFAULT '1',
  is_active varchar(2) NOT NULL DEFAULT 'Y',
  log_id int(11) unsigned NOT NULL AUTO_INCREMENT,
  log_userid varchar(32) NOT NULL,
  log_action varchar(8) NOT NULL,
  log_created_date datetime NOT NULL,
  PRIMARY KEY (log_id)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

DROP TABLE IF EXISTS log_products;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE log_products (
  `id` int(11) DEFAULT NULL,
  category_id int(5) DEFAULT NULL,
  products_name varchar(255) DEFAULT NULL,
  products_price decimal(10,2) DEFAULT NULL,
  products_short_description longtext,
  products_detail_description longtext,
  is_active char(1) DEFAULT 'Y',
  `date` datetime DEFAULT NULL,
  is_best char(1) DEFAULT 'Y',
  log_id int(11) NOT NULL AUTO_INCREMENT,
  log_userid varchar(32) NOT NULL,
  log_action varchar(8) NOT NULL,
  log_created_date datetime NOT NULL,
  PRIMARY KEY (log_id) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

